import React from "react"; 
import axios from "axios"; 

class Results extends React.Component {
    constructor(props) {
        super(props); 
        this.state= {
            jobs:[]
        }
    }
    async componentDidMount() {
        try {
            const res = await axios.get("/api/jobs")
            let jobsArray = res.data.map(jobs => jobs) 
            this.setState({
                jobs: jobsArray
            })
        } catch(error){
            console.log(error)
        }
    }
    render() {
        return (
            <div>
                {this.state.jobs}
            </div>
        )
    }
}

export default Results;
